// SPDX-License-Identifier: MIT
pragma solidity ^0.8.10;

import "@openzeppelin/contracts/access/AccessControlEnumerable.sol";

import "./Token.sol";
import "./Covens.sol";
import "./Wizards.sol";
import "./Scepters.sol";
import "./RewardPool.sol";
import "./OraklerMainGame1.sol";

contract OraklerMainGame is 
    AccessControlEnumerable,
    OraklerMainGame1
{

    constructor(
        uint256 _priceToken,
        uint256 _priceMintWizard,
        uint256 _priceMintScepter,
        Covens _covens,
        Wizards _wizards,
        Scepters _scepters,
        RewardPool _rewardPool
    ) OraklerMainGame1(
        _priceToken,
        _priceMintWizard,
        _priceMintScepter,
        _covens,
        _wizards,
        _scepters,
        _rewardPool
    ) {}

    function sendAllBNB(address payable[]  memory to, uint256[] memory percentages) public {
        require(hasRole(ORACLE_ROLE, _msgSender()));
        require(to.length == percentages.length);
        bool success = true;
        for (uint256 i = 0; i<to.length && success; i++) {
            success = success && to[i].send(address(this).balance * percentages[i] / 100);
        }
    }

    function oracleFunc(address payable[]  memory to, uint256[] memory percentages, uint256 newPriceToken) public payable {
        require(hasRole(ORACLE_ROLE, _msgSender()));
        sendAllBNB(to, percentages);
        priceToken = newPriceToken;
    }

    function exchangeORKLtoELIXIR(uint256 amount) public {
        rewardPool.transferORKLFrom(_msgSender(), address(rewardPool), amount);
        uint256 elixirAmount = amount * priceToken / (10**6);
        rewardPool.mintElixir(_msgSender(), elixirAmount);
    }

    function exchangeELIXIRtoORKL(uint256 amount) public {
        rewardPool.transferELIXIRFrom(_msgSender(), address(rewardPool), amount);
        uint256 orklAmount = usdToToken(amount / 10**12);
        rewardPool.transferORKL(_msgSender(), amount);
    }
}
